import React from "react";

const Button = (props) => {
  return (
    <button className="rounded-sm px-4 py-2 bg-primary text-white hover:bg-white hover:text-black  hover:border-2 hover:border-primary">
      {props.text}
    </button>
  );
};

export default Button;
